import unittest
from src.face_sdk import LivenessDetectionClient

class TestLivenessDetectionClient(unittest.TestCase):

    def setUp(self):
        self.client = LivenessDetectionClient(
            model_path="./liveness.model",
            le_path="label_encoder.pickle",
            encodings_path="encoded_faces.pickle",
            detector_folder="face_detector"
        )

    def test_detect_liveness(self):
        # Use a sample base64 image to test
        image_base64 = ""
        result = self.client.detect_liveness(image_base64)
        print("result",result)
        self.assertIsInstance(result, list)
        self.assertGreater(len(result), 0)

if __name__ == "__main__":
    unittest.main()
